css:
/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.incompatible-packages {
  background-color: #2e3138;
  overflow-y: scroll;
}
.incompatible-packages .incompatible-package {
  padding: 15px;
  margin-bottom: 10px;
  border-radius: 6px;
  border: 1px solid #1b1d22;
  background-color: #393d46;
  overflow: hidden;
}
.incompatible-packages .incompatible-package .badge {
  margin-left: 1em;
}
.incompatible-packages .incompatible-package .heading {
  margin-top: 0px;
}
.incompatible-packages .incompatible-package ul {
  padding-left: 1em;
}
.incompatible-packages .incompatible-package li {
  list-style-type: none;
}
.incompatible-packages .incompatible-package pre {
  margin-top: 2em;
  max-height: 25em;
  overflow: scroll;
  color: #ff6347;
}
.incompatible-packages-status {
  padding-left: 2px;
}
